('eu', '_template', 'atutor_is', '<strong><em>ATutor</em></strong>, <strong>Irakasgaiak Kudeatzeko Sistema (Learning Content Management System, LCMS)</strong> bat da, iturburuetan irekia, webetan oinarritua, eta erraz erabili zein egokitzen dena. Administratzaileek minutu gutxi batzuetan instala edo egunera dezakete ATutor. Irakasleek laster batean presta, bil eta bana dezakete irakasgaia Internet bidez. Ikasleek, bestetik, beren beharretara egokitzen den giroan ikasten dute.', '2004-12-29 11:56:03', ''),
('eu', '_template', 'atutor_links', '<p><a href=\"http://atutor.ca/index.php\">ATutor</a>-i buruz gehiago jakiteko, araka itzazu honako estekak:</p> <ul> <li><a href=\"http://www.atutor.ca/howto.php\">ATutor <em>Erabiltzeko</em> Ikastaroa</a> - Ikasi ATutor erabiltzen, gida instruktibo honi esker</li> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">Maiz Egiten diren Galderak</a> - Maiz egiten diren galderak eta beren erantzunak</li> <li><a href=\"http://atutor.ca/forums/index.php\">Foro lagungarriak</a> - Parte hartu erabiltzaileen foroetan</li> <li><a href=\"http://atutor.ca/services/index.php\">Zerbitzu Lagungarriak</a> - Gure laguntza behar baduzu, hementxe gauzkazu</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Itzulpena</a> - Jaitsi hizkuntzen paketeak eta egin zaitez itzultzaile</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Lizentziak</a> - Dohainik eskura dezakezu ATutor software-a, baldintza jakin batzuetan betiere</li> <li><a href=\"http://atutor.ca/atutor/download.php\">ATutor jaitsi</a> - ATutor-ek funtzionatzeko behar dituen software sistema guztiak eskura ditzakezu hemen</li> </ul>', '2004-12-29 14:03:44', ''),
