('eu', '_template', 'chat_help_display_blurb', '<p>Oharra: <em>Norabaitera joateko</em> estekak eta <em>Tekla azkarren zerrenda</em>, <em>Nabigatzeko laguntza</em> zure hobespenetan aktibatuta daukazunean bakarrik agertzen dira. Goialdean agertzen den </p> <ul> <li>The <em>Joan tekla azkarretara</em> estekak, berriketan aritzeko tekla azkarren zerrenda batera eramango zaitu. </li> <li> <em>Mezuen areak</em>, mezurik berrienak erakutsiko dizkizu (azken hamarrak). </li> <li> <em>Joan mezuetara</em> estekak, mezuen zerrendaren hasierara eramango zaitu. (Alt+M) </li> <li> <em>Mezuak freskatzeko</em> estekak, mezu berririk ba ote dagoen begiratzen uzten dizu (Alt+R). </li> <li> <em>Idatzi mezuak</em> estekak eta <em>Bidaltzeko botoiak</em>, mezuak idatzi eta bidaltzen utziko dizute (Alt+C mezuak sortzeko arean sartzeko, eta Enter idatzitako mezua bidaltzeko). </li> </ul>', '2004-12-29 14:40:28', ''),
